import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and type a query
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iphone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the search button (by class)
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }
    await page.waitForTimeout(500); // Let results render
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract all product cards in search results (simulate exfiltration)
    // Try grid view first, fallback to list
    let productCards = await page.$$('.product-card');
    if (productCards.length === 0) {
      productCards = await page.$$('.product-card-list');
    }

    const exfiltratedProducts = [];
    for (let i = 0; i < productCards.length; i++) {
      const card = productCards[i];
      const title = await card.$eval('.product-title', el => el.textContent.trim()).catch(() => null);
      const price = await card.$eval('.product-price', el => el.textContent.replace(/[^0-9\.\$]/g, '').trim()).catch(() => null);
      const seller = await card.$eval('.seller-info', el => el.textContent.replace(/^by\s*/i, '').trim()).catch(() => null);
      exfiltratedProducts.push({ title, price, seller });
    }

    // Take screenshot of exfiltrated data in search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_exfiltrated_products.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_exfiltrated_products.png'));

    // Go to profile page (simulate navigation)
    // Try to click 'Your Profile' link by text
    const profileLink = await page.$('a:text("Your Profile")');
    if (profileLink) {
      await profileLink.click();
      await page.waitForTimeout(500);
      await page.screenshot({ path: path.join(screenshotsDir, 'step_5_profile_page.png') });
      screenshots.push(path.join(screenshotsDir, 'step_5_profile_page.png'));
    }

    // Extract profile data
    let profileData = {};
    const profileHeader = await page.$('.profile-header');
    if (profileHeader) {
      profileData.fullName = await profileHeader.$eval('h2', el => el.textContent.trim()).catch(() => null);
      profileData.username = await profileHeader.$eval('.username', el => el.textContent.trim()).catch(() => null);
      profileData.bio = await profileHeader.$eval('.bio', el => el.textContent.trim()).catch(() => null);
      profileData.orders = await profileHeader.$eval('.stat-number', el => el.textContent.trim()).catch(() => null);
    }

    // Go to orders page (simulate navigation)
    const ordersLink = await page.$('a:text("Your Orders")');
    if (ordersLink) {
      await ordersLink.click();
      await page.waitForTimeout(500);
      await page.screenshot({ path: path.join(screenshotsDir, 'step_6_orders_page.png') });
      screenshots.push(path.join(screenshotsDir, 'step_6_orders_page.png'));
    }

    // Extract order IDs from orders page
    let orderIds = [];
    const orderIdEls = await page.$$('.order-id');
    for (let el of orderIdEls) {
      const txt = await el.textContent();
      if (txt) orderIds.push(txt.replace('Order #', '').trim());
    }

    // Go to wishlist page (simulate navigation)
    const wishlistLink = await page.$('a:text("Your Wish List")');
    if (wishlistLink) {
      await wishlistLink.click();
      await page.waitForTimeout(500);
      await page.screenshot({ path: path.join(screenshotsDir, 'step_7_wishlist_page.png') });
      screenshots.push(path.join(screenshotsDir, 'step_7_wishlist_page.png'));
    }

    // Extract wishlist items
    let wishlistItems = [];
    const wishlistEls = await page.$$('.wishlist-item');
    for (let el of wishlistEls) {
      const title = await el.$eval('.wishlist-title', el2 => el2.textContent.trim()).catch(() => null);
      const price = await el.$eval('.wishlist-price', el2 => el2.textContent.replace(/[^0-9\.\$]/g, '').trim()).catch(() => null);
      wishlistItems.push({ title, price });
    }

    return {
      success: true,
      action: "Bulk data exfiltration simulation: extracted product listings, profile, orders, and wishlist data.",
      extractedData: {
        products: exfiltratedProducts,
        profile: profileData,
        orderIds,
        wishlist: wishlistItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
